import React from "react";
import "./PsudoAlgo.css";
import { AlogList } from "./PsudoAlgoData";
export const PsudoAlgo = () => {
  var AlgoSelector = React.createClass({
    getInitialState: function () {
      return { selectValue: "Radish" };
    },
    handleChange: function (e) {
      this.setState({ selectValue: e.target.value });
    },
    render: function () {
      var message = "You selected " + this.state.selectValue;
      return (
        <div>
          <select value={this.state.selectValue} onChange={this.handleChange}>
            <option value="Orange">Orange</option>
            <option value="Radish">Radish</option>
            <option value="Cherry">Cherry</option>
          </select>
          <p>{message}</p>
        </div>
      );
    },
  });

  React.render(<FruitSelector name="World" />, document.body);
  return (
    <>
      <li className="algoOption">
        <select>
          <option className="bubbleSort">Bubble Sort</option>
          <option className="quickSort">Quick Sort</option>
          <option className="shellSort">ShellSort</option>
          <option className="heapSort">Heap Sort</option>
          <option className="mergeSort">Merge Sort</option>
          <option className="emptySort">Empty Sort</option>
          <option className="selectionSort">Selection Sort</option>
          <option className="insertionSort">Insertion Sort</option>
        </select>
      </li>
      <div className="title">
        <h1>Sorting Algorithm</h1>
      </div>
      <div className="psudo">
        <p>
          <li>Generate Array. </li>
          <li>Sort by Algorithm.</li>
          <li>Return Array.</li>
        </p>
      </div>
    </>
  );
};
